import { Table, Tag } from "antd";

function ThreatsTable() {
  return (
    <div>
      <h3 style={{ color: "white" }}>Detected Cyber Security Threats</h3>
      <Table
        dataSource={dataSource}
        columns={columns}
        pagination={{
          defaultPageSize: 5,
        }}
      />
    </div>
  );
}

const dataSource = [
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.100",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.101",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.102",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.103",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.104",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.105",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.106",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.107",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.108",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
  {
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.109",
    mac: "255.255.255.0",
    threat: "Trojan",
  },
];

const columns = [
  {
    title: "Date / Time",
    dataIndex: "datetime",
    key: "datetime",
  },
  {
    title: "Targeted IP Address",
    dataIndex: "ip",
    key: "ip",
  },
  {
    title: "MAC Address",
    dataIndex: "mac",
    key: "mac",
  },
  {
    title: "Threat Type",
    dataIndex: "threat",
    key: "threat",
    render: (tags) => (
      <>
        {tags.map((tag) => {
          let color = tag.length > 5 ? "geekblue" : "green";
          if (tag === "loser") {
            color = "volcano";
          }
          return (
            <Tag color={color} key={tag}>
              {tag.toUpperCase()}
            </Tag>
          );
        })}
      </>
    ),
  },
];

export default ThreatsTable;
